import React from 'react'
import auth from '../components/auth'

const ProjectPage =()=>{
    return (
        <div>
                <h1>Projects</h1>
            <button onClick={()=>{
                auth.logout(()=>{
                    this.props.history.push("/")
                })
            }}>Logout</button>
        </div>
    )
}
export default ProjectPage;
